import customer from '../images/customer.png';
const CustomerLogin = ()=>{
    return (
<div className="border"  style={{display: 'flex',  justifyContent:'center', alignItems:'center'}}>
<form className='container jumbotron flex'>
    <div className="flex-left">
    <img src={customer} alt="customer missing" className="rounded mx-auto d-block" height="300px"></img>
        <h1>Customer Login</h1>
    </div>
<div className="flex-right">
  <div className="form-group">
    <label>Username</label>
    <input type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" required/>
    <label >Password</label>
    <input type="text" className="form-control" id="exampleInputPassword1" required/>
  </div>

  <button type="submit" className="btn btn-primary">Submit</button>
  </div>
</form>
</div>

    );
};

